  const taskListHandler = (totalTasks) => {
    const tasks = {
      ...totalTasks,
    };
    console.log(tasks)
  };
  return (
    <div>
      <h1>Hello</h1>
      <TaskForm onSaveTasksList={taskListHandler} />
      <ClearList></ClearList>
      <TaskList />
    </div>
  );
};

export default App;
